import React from 'react'
import { Box, Grid, Container } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'

const styles = (theme) => ({
    root : {
        marginTop : 20
    },
    addressWrapper : {
        width : "95%",
        height : 500,
        boxShadow : "0px 0px 2px 1px rgba(0,0,0,0.3)",
        borderRadius : 10
    },
    calculationWrapper : {
        width : "60%",
        height : "100%",
        boxShadow : "0px 0px 2px 1px rgba(0,0,0,0.3)",
        borderRadius : 10
    }
})

const Order = ({ classes }) => {
    return (<Box className={classes.root}>
        <Container>
            <Grid container >
                <Grid item xs={12} sm={12} md={10} lg={8} xl={8} style={{}}>
                    <Box className={classes.addressWrapper}>

                    </Box>
                </Grid>
                <Grid item xs={12} sm={12} md={2} lg={4} xl={4}>
                    <Box className={classes.calculationWrapper}>

                    </Box>
                </Grid>
            </Grid>
        </Container>
    </Box>)
}

Order.propTypes = {
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Order)
